import React from 'react'
import { View,Text,StyleSheet } from 'react-native'

export default function App() {
  return (
    <View style={styles.HeadView}>
      <View style={styles.flexOneView}>
        <View style={{flex:0.7,backgroundColor:'blue'}}></View>
      </View>
      <View style={styles.flexTwoView}>
      </View>
      <View style={styles.flexThreeView}>
      </View>
      <View style={styles.flexFourView}>
      </View>
      <View style={styles.flexFiveView}>
      </View>
    </View>
  )
}
const styles=StyleSheet.create({
HeadView:{
    flex:1
},
flexOneView:{
   flex:1,
   backgroundColor:'orange',
   flexDirection:'row'
},
flexTwoView:{
    flex:1,
   backgroundColor:'skyblue'
},
flexThreeView:{
    flex:1,
    backgroundColor:'#f76b5c'
},
flexFourView:{
    flex:1,
    backgroundColor:'#eb968d'
},
flexFiveView:{
    flex:1,
    backgroundColor:'#faba5a'
}


})
